import React from 'react';
import styled from 'styled-components';
import { Text } from '../../components/webcomps';

const BgWrapper = styled.div`
  height: 1200px;
  background-image: linear-gradient(rgba(54, 0, 51, 1), rgba(11, 135, 147, 1)) !important;
`;
const Hack = () => (
  <BgWrapper>
    <Text size="30px">W</Text>
  </BgWrapper>
);

export default Hack;
